import React from 'react'

export default function SegundoComponente() {

    const libros = ["Harry Potter", "Juego de tronos", "Clean Code"]

  return (
    <div className='segundo-componente'>
        <h1>Listado de libros</h1>
        <ul>
            {
                libros.forEach(libro => {
                    return <li>{libro}</li>;
                })
            }
        </ul>
        

    </div>
  )
}
